import { combineReducers } from 'redux';

import * as bill from './bill'



const appReducers = combineReducers({
    total_revenue : bill.total_revenue,
    count_bill : bill.count_bill,
    total_debit_bill : bill.total_debit_bill,
    sum_debit_bill : bill.sum_debit_bill,
    count_unpaid_bill : bill.count_unpaid_bill,
    total_unpaid_bill : bill.total_unpaid_bill

  
});

export default appReducers;
